import React, { Component } from 'react'

export default class user extends Component {
    render() {
        return (
            <React.Fragment>
                <form>
                    <label>UserName : </label>
                    <input type="text"></input>
                    <label>Password : </label>
                    <input type="text"></input>
                    <button type="button" onClick="this.props.clickData">Logout</button>
                </form>
            </React.Fragment>
        )
    }
}
